import { FuseLoadable } from "owp/@fuse";

export const C805000Config = {
    settings: {
        layout: {
            config: {}
        }
    },
    routes  : [
        {
            path     : '/pages/C805000',
            component: FuseLoadable({
                loader: () => import('./C805000')
            })
        }
    ]
};
